-- Version: v1.6
--
-- Description: Migration that introduces the manager type manager relation
-- -------------------------------------------------

CREATE TABLE k_Manager_TypeManager (
    ID integer,
    IDTMR_MAN integer,
    lodMAN character varying(255) NOT NULL,
    lodRelation character varying(255),
    lodTMR character varying(255),
    populatedBy character varying(255),
    lastTouch character varying(255),
    PRIMARY KEY (lodMAN, lodTMR),
    FOREIGN KEY (lodMAN) REFERENCES k_Manager(lodMAN) ON DELETE CASCADE,
    FOREIGN KEY (lodTMR) REFERENCES k_Type_Manager(lodTMR) ON DELETE CASCADE
);


